final boolean skipTo(int target) throws IOException {
  if (!tp.skipTo(target)) {
    tp.close();				  // close stream
    doc = Integer.MAX_VALUE;			  // sentinel value
    return false;
  }
  doc = tp.doc();
  position = 0;
  return true;
}

